  width: 360px;
  margin-bottom: 45px;
  cursor: pointer;

`;

const Details = styled.div`
  display: flex;
  margin-top:16px;
  gap: 12px;
`;

const ChannelImage = styled.img`
  width: 36px;
  height: 36px;
  border-radius: 50%;
`;

const Image = styled.img`
  height: 100%;
  height: 202px;
`;

const Texts = styled.div`

`;

const Title = styled.h1`
  font-size: 16px;
  font-weight: 500;
  color: ${({theme})=> theme.text};
`;

const ChannelName = styled.h2`
  font-size: 14px;
  color: ${({theme})=> theme.textSoft};
  margin: 9px 0px;
`;

const Info = styled.div`
  font-size: 14px;
  color: ${({theme})=> theme.textSoft};
`;

const Card = () => {
  return <Container><Image src={thumbnail_default}/>
  <Details>
    <ChannelImage src={pfp_default}/>
    <Texts>
    <Title>God Did</Title>
    <ChannelName>R. Steiner</ChannelName>
